/* global Handlebars */
Handlebars.registerHelper('ifIn', function (elem, list, options) {
    if (list.indexOf(elem) > -1) {
        return options.fn(this);
    }
    return options.inverse(this);
});

Handlebars.registerHelper("is", function(value, test, options) {
   if (value && value === test) {
       return options.fn(this);
   }
       return options.inverse(this);
});

Handlebars.registerHelper("isnt", function(value, test, options) {
    if (!value || value !== test) {
        return options.fn(this);
    }
        return options.inverse(this);
});

Handlebars.registerHelper("exists", function(value, options) {
    if (value !== undefined && value !== null && value !== '' && !htmlIsWhitespace(value)) {
        return options.fn(this);
    }
    return options.inverse(this);
});

Handlebars.registerHelper('ifCond', function (v1, operator, v2, options) {

    switch (operator) {
        case '==':
            return (v1 == v2) ? options.fn(this) : options.inverse(this);
        case '===':
            return (v1 === v2) ? options.fn(this) : options.inverse(this);
        case '<':
            return (v1 < v2) ? options.fn(this) : options.inverse(this);
        case '<=':
            return (v1 <= v2) ? options.fn(this) : options.inverse(this);
        case '>':
            return (v1 > v2) ? options.fn(this) : options.inverse(this);
        case '>=':
            return (v1 >= v2) ? options.fn(this) : options.inverse(this);
        case '&&':
            return (v1 && v2) ? options.fn(this) : options.inverse(this);
        case '||':
            return (v1 || v2) ? options.fn(this) : options.inverse(this);
        default:
            return options.inverse(this);
    }
});

Handlebars.registerHelper('meridian', function(hour){
    if (hour === 0) return (hour+12)+'am';
    if (hour < 12) return hour+'am';
    if (hour >= 12) return (hour-12)+'pm';
});

Handlebars.registerHelper("isNaN", function(value, options) {
    if (value && isNaN(value)) {
        return options.fn(this);
    }
    return options.inverse(this);
});

Handlebars.registerHelper('ternary', function (test, yes, no) {
    return test ? yes : no;
});


function htmlIsWhitespace(input) {
    var visible = [
            'img','iframe','object','hr',
            'audio', 'video',
            'form', 'button', 'input', 'select', 'textarea'
        ],
        container = document.createElement('div');
    container.innerHTML = input;
    return !(container.innerText.trim().length > 0 || container.querySelector(visible.join(',')));
}

