common.dynFormUtils = (function ($) {
    var dynFormUtils = {};

    /**
     * Encrypt and decrypt the form data using the servlet
     * @param operation - Can be either 'encryption' or 'decryption'
     * @param data - The string to send to the servlet
     * @returns promise
     */
    dynFormUtils.encryptDecryptStoredData = function (operation, data) {
        var d = $.Deferred();
        if (!data && operation === 'decryption') {
            // If there is no data to decrypt, return an empty promise resolved with an empty array
            return d.resolve('[]');
        }

        acquireEncryptionKey()
            .then(function(key) {
                try {
                    if (operation === 'decryption') {
                        /* jshint ignore:start */
                        d.resolve(sjcl.decrypt(key, data));
                        /* jshint ignore:end */
                    } else {
                        /* jshint ignore:start */
                        d.resolve(sjcl.encrypt(key, data));
                        /* jshint ignore:end */
                    }
                } catch(e) {
                    d.resolve('[]'); // if we can't encrypt/decrypt proceed as there is no data
                }
            })
            .fail(function() {
                d.resolve('[]');
            });

        return d.promise();
    };

    var acquireEncryptionKey = function() {
        var d = $.Deferred();
        if (dynFormUtils.key) {
            // If key is already available use it directly
            return d.resolve(dynFormUtils.key);
        }

        $.get('/content/dam/virginmedia/dotcom/static/key.txt')
            .then(function(key) {
                dynFormUtils.key = key;
                return d.resolve(key);
            });
        
        return d;
    };

    dynFormUtils.toggleSpinner = function() {
        $('section.csjt-checkout-template').find('.cms-spinner').toggleClass('hidden');
    };

    dynFormUtils.continueJourney = function($form) {
        dynFormUtils.hideBannerMessages();
        $form.submit();
    };

    /**
     * @param $form - to be serialized
     * @param emailSubjectFieldName
     * @returns {{}}
     */
    dynFormUtils.serializeForm = function($form, emailSubjectFieldName, skipDiscarding) {
        if (skipDiscarding !== true) {
            $form.find('.discard-input').each(function(index) {
                $(this).val('');
            });
        }
        var formData = $form.find('input, .dropdown select, textarea')
                .not('.ignore, .wrapper-ignore, .quickstart-ignore').serializeArray(),
            formDataObject = {},
            emailSubjectField = $form.find('[name="' + emailSubjectFieldName + '"]')[0],
            emailSubjectValue = emailSubjectField && emailSubjectField.value;

        $.each(formData, function() {
            var name = this.name;
            var value = this.value;

            // do not send empty fields
            if (!value) {
                return;
            }
            // remove g-recaptcha-response from submit data
            if (name === 'g-recaptcha-response') {
                return;
            }
            // ignore mapping for cq generated hidden field
            if (name.indexOf(':') > -1) {
                return;
            }
            // map checkbox field value
            if (value === "on") {
                value = true;
            }
            // populate email subject with selected dropdown option
            if (value && $form.find('[name="' + name + '"]').data('populateEmailSubject')) {
                emailSubjectValue = emailSubjectValue + ',' + value;
            }

            formDataObject[name] = value;
        });

        return formDataObject;
    };


    /** hides all banner-style messages on the page
     * IF banner message was JS injected into DOM (prepend,append) -> use remove()
     * ELSE banner message is imported with sly as HTML from custom components -> use class 'hidden'
     */
    dynFormUtils.hideBannerMessages = function() {
        $('.dyn-form-message-banner').each(function () {
            var $banner = $(this);
            if ($banner.hasClass('dyn-form-message-banner-js')) {
                $banner.remove();
            } else {
                $banner.addClass('hidden');
            }
        });

    };
    /**
     * USED IN CSJT JOURNEY
     * display a banner-style message inside a target DOM element
     * type can be 'error', 'success', 'info' or 'warning'
     * @param msg
     * @param $targetElem
     * @param type
     * @param scrollToTop
     * @param hideBannerMessages
     */
    dynFormUtils.displayBannerMsg = function(msg, $targetElem, type, scrollToTop, hideBannerMessages) {
        var banner = '<div class="dyn-form-message-banner ' +
            'dyn-form-message-banner-js dyn-form-message-banner-' +
            type + '">' + '<div>' + msg + '</div>' + '</div>';
        if (hideBannerMessages) {
            dynFormUtils.hideBannerMessages();
        }
        $targetElem.prepend(banner);

        if (scrollToTop) {
            $('html, body').animate({ scrollTop: 0 }, 'slow');
        }
    };

    /**
     * USED IN ACE JOURNEY
     * Populate and show specific message banner
     * @param $element - The targeted message banner element
     * @param text - The string to be placed in the message banner
     * @param $form - The form element containing the message banner
     */
    dynFormUtils.showAceMessageBanner = function($element, text, $form) {
        $.fn.isInViewport = function() {
            var elementTop = $(this).offset().top;
            var elementBottom = elementTop + $(this).outerHeight();
            var viewportTop = $(window).scrollTop();

            return elementBottom > viewportTop;
        };

        if (text) {
            $element.find('div').text(text);
        }

        // Hide all message banners and show the specific one
        $form.find('.dyn-form-message-banner').addClass('hidden');
        $element.removeClass('hidden');

        // If error message is not in the viewport, scroll the message banner into view
        if (!$element.isInViewport()) {
            $('html, body').animate({
                scrollTop: $element.offset().top
            }, 500);
        }
    };

    /**
     * Handle error returned by an API call accordingly based on API configuration
     * @param failedApiCalls - an array of objects, each containing xhr and apiLabel.
     * If a single object is passed, it will be added to an array to match structure.
     * @param $targetElement - div to which the error banner will be appended to
     * @param type - error, warning, info, success
     * @param scrollToTop - true/false
     * @param hideBannerMessages - true/false
     * @param toggleSpinner - true/false
     * @param cbErrMatch - Callback function when error is matched
     * @param cbErrNotMatched - Callback function when error is not matched
     */
    dynFormUtils.handleApiErrors = function(failedApiCalls, $targetElement, type, scrollToTop,
                                            hideBannerMessages, toggleSpinner, cbErrMatch, cbErrNotMatched) {
        var getErrorConfigCollection = [];
        failedApiCalls = Array.isArray(failedApiCalls) ? failedApiCalls : [failedApiCalls];

        failedApiCalls.forEach(function (errorItem) {
            var getErrorConfigCall = dynFormUtils.getApiError(errorItem.apiLabel, errorItem.xhr);
            getErrorConfigCollection.push(getErrorConfigCall);
        });

        // after all error configurations are retrieved, check if error match
        $.when.apply(null, getErrorConfigCollection).then(function() {
            var errorMatched = false;
            for (var i = 0; i < arguments.length; i++) {
                var errorObj = arguments[i];
                if (errorMatched) {
                    break;
                }
                // always stop at first match of an error
                // if API configured with error message, it displays the error message
                // if API configured with redirect, will redirect to specified URL
                if (errorObj) {
                    // fallback if scrollTop param is missing from function call
                    scrollToTop = scrollToTop === null ? scrollToTop = errorObj.scrollToTop : scrollToTop;
                    if (errorObj.redirectPage) {
                        dynFormUtils.setJourneyMiscFlag('forceRedirect', true, VMCSJT);
                        errorMatched = true;
                        window.location.href = errorObj.redirectPage;
                        return false;
                    } else if (errorObj.errorMessage) {
                        dynFormUtils.displayBannerMsg(errorObj.errorMessage, $targetElement, type, scrollToTop,
                            hideBannerMessages);
                        errorMatched = true;
                    }
                }
            }
            if (toggleSpinner) {
                dynFormUtils.toggleSpinner();
            }
            // trigger callback
            if (!errorMatched && cbErrNotMatched && typeof cbErrNotMatched === 'function') {
                cbErrNotMatched();
            }
            // trigger callback
            if (errorMatched && cbErrMatch && typeof cbErrMatch === 'function') {
                cbErrMatch();
            }
        });
    };

    /**
     * Get the index of a form data object in a forms data array based on that object's formID
     * @param formID - The form's ID attribute value
     * @param dataSet - Array containing form data objects
     * @returns {number}
     */
    dynFormUtils.getFormDataIndexById = function(formID, dataSet) {
        for (var i = 0; i < dataSet.length; i++) {
            if (dataSet[i].formID === formID) {
                return i;
            }
        }

        // If not found, return -1;
        return -1;
    };

    /**
     * Get API error configuration based on apiLabel, http code and fault code
     * @param apiLabel - you can find it in the api config JSON object field apiLabel
     * @param xhr - error xhr object returned by the ajax API call
     * @returns - error object JSON, may contain redirectPage - if desired outcome is to redirect,
     *              or errorMessage if desired outcome is a message to be displayed
     */
    dynFormUtils.getApiError = function(apiLabel, xhr) {
        var errCode = parseInt(xhr.status),
            faultCode = xhr.responseJSON && xhr.responseJSON[0] && xhr.responseJSON[0].faultCode;

        return common.AsyncService.ajaxPromise(
            {
                method: 'GET',
                url: "/services/api/errors-api-config?apiLabel=" + apiLabel
            }).then(function(response) {
                var errorsArr = response.errors;
                // try to match both Fault Code and Http Error code
                // If both Fault code and Http error code matches, return the corresponding error
                // else search for a fallback error just for the Http error code
                var matchFaultCodeAndHttpCode = errorsArr.find(function (item) {
                    return parseInt(item.httpCode) === errCode && item.faultCode === faultCode;
                });
                var matchAnyFaultCodeForHttpCode = errorsArr.find(function (item) {
                    return parseInt(item.httpCode) === errCode && !item.faultCode;
                });
                if (matchFaultCodeAndHttpCode) {
                    return matchFaultCodeAndHttpCode;
                } else if (matchAnyFaultCodeForHttpCode) {
                    return matchAnyFaultCodeForHttpCode;
                } else {
                    return null;
                }
        });
    };

    /**
     * Populate forms with stored data and trigger the appropriate events on their elements
     * @param formID - The form's ID attribute value
     * @param formData - Object containing form values
     */
    dynFormUtils.setFormValues = function($form, formData) {
        $.each(formData, function (name, value) {
            if (name === 'reCaptchaToken') {
                return;
            }

            var $field = $form.find('[name="' + name + '"]'),
                fieldType = $field[0] &&
                    ($field[0].tagName !== 'INPUT' ? $field[0].tagName : $field[0].type).toLowerCase();

            if (!fieldType) {
                return;
            }

            if (fieldType === 'radio') {
                // Set value for radio buttons
                $field.filter('[value="' + value + '"]').trigger('click');
            } else if (fieldType === 'checkbox') {
                // Set value for checkboxes
                $field.prop('checked', (value === 'on')).trigger('click');
            } else if (fieldType === 'hidden') {
                // Set value for hidden fields
                $field.val(value);

                // Set home phone number value
                if ($field.hasClass('dyn-form-phone-number-hidden')) {
                    $field.siblings('input.dyn-form-phone-number').val(value).trigger('input');
                }
            } else {
                // Set value for all other form elements and trigger the appropriate event
                $field.val(value).trigger((fieldType === 'select' ? 'change' : 'input'));

                // Set Time Picker component visible value
                if ($field.hasClass('ace-field-time')) {
                    var time = value.split(':');

                    $field.siblings('input.ace-field-hours').val(time[0]);
                    $field.siblings('input.ace-field-mins').val(time[1]);
                }
            }
        });

        // Let other components know the form has been populated
        $form.addClass('dyn-form-ready dyn-form-ready-repopulated').trigger('dynFormReady');
    };

    /**
     * Displays a Bootstrap Modal, checks if the content height is bigger that the window height
     * And adds the specific CSS classes in order to scroll the content properly
     * @param $modalContainer - The modal container to display
     */
    dynFormUtils.modalWithContentOverflow = function($modalContainer) {
        var $modalDialog = $modalContainer.find('.modal-dialog');

        $modalContainer.modal();
        var modalHeight = $modalContainer.find('.modal-backdrop').outerHeight(),
            viewportHeight = $(window).outerHeight();
        // if modal is taller than viewport, add specific CSS class
        if (modalHeight > viewportHeight) {
            $modalDialog.addClass('modal-dialog-overflowing');
        } else {
            $modalDialog.removeClass('modal-dialog-overflowing');
        }
        $modalContainer.modal('handleUpdate');
    };

    /**
     * Set a flag in the journeyMisc object in both session storage and global variable
     * @param property - The property to be set
     * @param value - The value to be set for property
     * @param VMCJST - global object
     */
    dynFormUtils.setJourneyMiscFlag = function(property, value, object) {
        var journeyMisc = JSON.parse(window.sessionStorage.getItem('journeyMisc')) || {};

        journeyMisc[property] = value;
        window.sessionStorage.setItem('journeyMisc', JSON.stringify(journeyMisc));

        object.journeyMisc = object.journeyMisc || {};
        object.journeyMisc[property] = value;
    };

    dynFormUtils.autopopulateFields = function(formID, fieldName, getFirstCharacter, fieldToPopulate) {
        var eData = window.sessionStorage.getItem('journeyData');

        dynFormUtils.encryptDecryptStoredData('decryption', eData).done(function (data) {
            data = JSON.parse(data) || [];

            var formIndex = dynFormUtils.getFormDataIndexById(formID, data);
            if (formIndex >= 0) {
                var value = data[formIndex].formData[fieldName];

                if(getFirstCharacter) {
                    value = value.substr(0,1);
                }

                if(value){
                    fieldToPopulate.val(value);
                    fieldToPopulate.addClass("has-value");
                }
            }
        });
    };

    /**
     * Check whether any of the criteria for skipping an element is true
     * @param arr - An array of criteria
     * @param allTrue - Require all operands to be true
     * @returns {boolean}
     */
    dynFormUtils.checkSkipElementCriteria = function(arr, allTrue) {
        var d = $.Deferred(),
            requiresFormsData = arr.some(function(criteria) { return typeof criteria === 'object'; }),
            formsData;

        // If we have any FromMatchValue criteria, get the forms data first
        if (requiresFormsData) {
            var enc = window.sessionStorage.getItem('journeyData');

            // Decrypt the session form data
            dynFormUtils.encryptDecryptStoredData('decryption', enc).then(function(dec) {
                formsData = JSON.parse(dec) || [];

                checkCriteria(arr);
            });
        } else {
            checkCriteria(arr);
        }

        function finishCheck(response) {
            if (response) {
                if (allTrue) {
                    checkCriteria(arr);
                } else {
                    d.resolve(true);
                }
            } else {
                if (allTrue) {
                    d.resolve(false);
                } else {
                    checkCriteria(arr);
                }
            }
        }

        // Internal recursive function for checking all the criteria until one is found to be true
        function checkCriteria(arr) {
            var criteria = arr.shift();

            if (criteria) {
                // If the criteria is a string, it's a basket content criteria
                if (typeof criteria === 'string') {
                    var check = window.VMCSJT.checkBasketContents(criteria);

                    if (typeof check === 'boolean') {
                        finishCheck(check);
                    } else {
                        check.then(function(response) {
                            finishCheck(response);
                        });
                    }
                } else {
                    // Otherwise, it's an object containing the form ID, field name and the value to be matched
                    var form = formsData.filter(function (form) { return form.formID === criteria.form; });

                    finishCheck(form.length && typeof form[0].formData[criteria.field] !== 'undefined' &&
                        form[0].formData[criteria.field] === criteria.value);
                }
            } else {
                if (allTrue) {
                    d.resolve(true);
                } else {
                    d.resolve(false);
                }
            }
        }

        return d.promise();
    };

    /**
     * Action to be performed after a form has been submitted
     * @param $form - the current form calling this function, null when used by CSJT form skip logic
     * @param data - object containing the data necessary to run the after submit action
     * @param isCSJT - Boolean flag for CSJT journeys
     * @param $curTab - current tab element for CSJT journeys
     * @param callback - function to be passed to jumpToTarget when used by CSJT form skip logic
     */
    dynFormUtils.afterSubmitAction = function($form, data, isCSJT, $curTab, callback) {
        switch (data.aftersubmit) {
            case 'refresh':
                location.reload();
                break;
            case 'redirect':
                window.location.href = data.redirecturl;
                break;
            case 'jump-to-form':
                // If we are in a CSJT journey
                if (isCSJT) {
                    window.VMCSJT.journey.utils.jumpToTarget(null, data.nextformid, $curTab, callback);
                } else {
                    // Hide the current form
                    $form.addClass('hidden');

                    // Make the target form visible and let the other components know
                    $('#' + data.nextformid).removeClass('hidden').trigger('dynFormVisible');
                }

                break;
            case 'jump-to-tab':
                // If we are in a CSJT journey
                if (isCSJT) {
                    window.VMCSJT.journey.utils.jumpToTarget(data.nexttabid, null, $curTab, callback);
                }

                break;
            default:
                var $successMsg = $form.find('.dyn-form-message-banner-success');

                // Display success message
                dynFormUtils.showAceMessageBanner($successMsg, null, $form);
                break;
        }
    };

    return dynFormUtils;

})(VMJSjQuery);

var aem = (function () {

    var extend = common.extend;

    return {
        extend: extend
    };

})();

aem.extend(aem, 'Constants');
aem.Constants = (function () {

    var Constants = Object.freeze({
        JCR_PROPERTIES_PREFIXES: ['jcr:', 'sling:', 'cq:']
    });

    return Constants;
})();

aem.extend(aem, 'QueryBuilder');
aem.QueryBuilder = (function ($) {

    var AsyncService = common.AsyncService;

    var QueryBuilder = {};

    var queryBuilderBaseUrl = "/services/api/dynamic-messages?";

    var prepareFilterParam = function (filter) {
        if (!filter) {
            return;
        }
        var finalSorting = '';
        var finalQuery = '';
        var orderIndex = filter.length + 1;
        for (var m = 0; m < filter.length; m++) {
            var propertyIndex = m + 1;
            var propertyName = propertyIndex + '_property';
            var queryPropertyName = propertyName + '=' + filter[m].name;
            var propertyValues = '';

            if(filter[m].values){
                for (var n = 0; n < filter[m].values.length; n++){
                    var valueIndex = n + 1;
                    var propertyValue = propertyName + '.'+ valueIndex +
                                        '_value=' + filter[m].values[n];
                    propertyValues+= '&' + propertyValue;
                }
            }
            if (filter[m].sort) {
                var queryOrder = orderIndex + '_orderby=' + propertyName;
                var querySort = orderIndex + '_orderby.sort=' + filter[m].sort;
                orderIndex ++;
                finalSorting+= '&' + queryOrder + '&' + querySort;
            }

            finalQuery = finalQuery + '&' + queryPropertyName;
            if(propertyValues) {
                finalQuery = finalQuery + propertyValues;
            }

        }

        return finalQuery + finalSorting;

    };

    QueryBuilder.getSelectiveData = function (selectiveDataParams) {

        var properties = selectiveDataParams.properties;
        var path = selectiveDataParams.path;
        var filter = selectiveDataParams.filter;
        var limit = selectiveDataParams.limit ? '&p.limit=' + selectiveDataParams.limit : '';


        var url = queryBuilderBaseUrl,
            props = $.isArray(properties) ? properties.join(' ') : properties,
            queryFilter = prepareFilterParam(filter),
            reqUrl = url.concat('path=', path, '&p.properties=', props,
                                '&p.hits=selective', limit,
                                queryFilter ? queryFilter : '');

        return AsyncService.ajaxPromise({
            url: reqUrl,
            type: 'GET'

        }).then(function (data) {
            if ($.isArray(data) && data.length > 1) {
                return data;
            }

            return data[0];
        });
    };

    return QueryBuilder;

})(VMJSjQuery);

aem.extend(aem, 'Utils');
aem.Utils = (function ($) {

    var Constants = aem.Constants;

    var Utils = {};

    Utils.getCleanedJCRObj = function (obj) {
        if (!obj) {
            return;
        }

        var newObj = Object.keys(obj).reduce(function (acc, key) {
            if (!Constants.JCR_PROPERTIES_PREFIXES.some(
                function (prefix) {
                    return key.indexOf(prefix) !== -1;
                })) {
                acc[key] = obj[key];
            }

            return acc;
        }, {});

        return newObj;
    };

    return Utils;

})(VMJSjQuery);

